 WTO.\n\n\ud83d\udde3Languages:\n\nFluency in English. A good working knowledge of either French or Spanish would be an advantage.\n\nMonthly Salary: CHF 4,000\n#WTOYoungProfessionalprogram\n\nYour favourite youth coach for career and global opportunities \ud83d\udc95 \n\n#qualityeducation#scholarships #mindset #billionairemindset\u00a0 #bloodygreatgirl #careersafrica #study #GRE #IELTS #masters #mastersscholarship #gradschool\n#manifestingabundance #scholarship #CVs #education #opportunities #cvreview #hovasabeehub #naijafrenchqueen #studyabroad #money #health #careers #askmeanything #explore\u00a0 #relationship#careercoach #employment"}}]},"shortcode":"Ccx1odgD1DK","edge_media_to_comment":{"count":0},"taken_at_timestamp":1650899834,"dimensions":{"height":995,"width":640},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/279218587_5658295350865729_914075269878496232_n.jpg?stp=dst-jpg_e15\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=101\u0026_nc_ohc=Vzme9kti3-UAX8WGyn6\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT86M87ocaehy72iJvGH7zkAzPK4Ivm09XPTOmMSHwbvYw\u0026oe=62B85017\u0026_nc_sid=4efc9f","edge_liked_by":{"count":11},"edge_media_preview_like":{"count":11},"owner":{"id":"3971813115"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/279218587_5658295350865729_914075269878496232_n.jpg?stp=c0.150.540.540a_dst-jpg_e15\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=101\u0026_nc_ohc=Vzme9kti3-UAX8WGyn6\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8CGVJh77wGM1VzmGVjrsZ77S4lMfcurvPz9RVpLEMT9Q\u0026oe=62B85017\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/279218587_5658295350865729_914075269878496232_n.jpg?stp=dst-jpg_e15_p150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=101\u0026_nc_ohc=Vzme9kti3-UAX8WGyn6\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8HvWHvA2tTRdG1e7peJKZu5nlOM5YDT6xQw4Nbm97QNA\u0026oe=62B85017\u0026_nc_sid